(40, 'Curso Avançado de C#', 'Torne-se um expert', , 'Neste curso avançado de C#, você aprenderá a dominar técnicas avançadas de programação, como LINQ, manipulação de arquivos, threads, e programação assíncrona. Além disso, o curso inclui padrões de design e práticas recomendadas para a criação de software robusto e eficiente.', 'Avançado em C#', '2024-06-30', 4, 'Gabriel', '15h', 150.00, 'https://www.youtube.com/watch?v=avancado-csharp', 1, 4);
INSERT INTO `cursos` (`id`, `titulo`, `subtitulo`, `foto`, `desc_principal`, `desc_secundaria`, `atualizacao`, `estrelas`, `criador`, `duracao`, `preco`, `conteudo`, `publicado`, `fornecedorid`) VALUES
(41, 'Desenvolvimento Web com ASP.NET', 'Web com ASP.NET', , 'Aprenda a construir aplicações web modernas e dinâmicas com ASP.NET. Este curso cobre desde os fundamentos do framework até a criação de projetos complexos. Você aprenderá sobre MVC, Web API, segurança, autenticação e autorização, e como integrar seu projeto com bancos de dados.', 'ASP.NET', '2024-06-30', 5, 'Fornecedor 2', '20h', 200.00, 'https://www.youtube.com/watch?v=aspnet-web', 1, 2);
INSERT INTO `cursos` (`id`, `titulo`, `subtitulo`, `foto`, `desc_principal`, `desc_secundaria`, `atualizacao`, `estrelas`, `criador`, `duracao`, `preco`, `conteudo`, `publicado`, `fornecedorid`) VALUES
(42, 'Curso de Xamarin Forms', 'Apps móveis com Xamarin', , 'Desenvolva aplicações móveis para Android e iOS utilizando o Xamarin Forms. O curso ensina a criar interfaces de usuário responsivas e adaptáveis, a trabalhar com APIs nativas e a integrar serviços de backend. Ideal para quem deseja entrar no mercado de desenvolvimento mobile.', 'Xamarin Forms', '2024-06-30', 4, 'Gabriel', '12h', 120.00, 'https://www.youtube.com/watch?v=xamarin-forms', 0, 4);
INSERT INTO `cursos` (`id`, `titulo`, `subtitulo`, `foto`, `desc_principal`, `desc_secundaria`, `atualizacao`, `estrelas`, `criador`, `duracao`, `preco`, `conteudo`, `publicado`, `fornecedorid`) VALUES
(43, 'Machine Learning com C#', 'ML com C#', , 'Explore o mundo do machine learning utilizando C#. Este curso abrange desde a preparação e manipulação de dados até a criação e treinamento de modelos de machine learning. Inclui exemplos práticos e projetos para aplicar o aprendizado na criação de soluções inteligentes.', 'Machine Learning', '2024-06-30', 5, 'Fornecedor 2', '25h', 250.00, 'https://www.youtube.com/watch?v=ml-csharp', 1, 2);
INSERT INTO `cursos` (`id`, `titulo`, `subtitulo`, `foto`, `desc_principal`, `desc_secundaria`, `atualizacao`, `estrelas`, `criador`, `duracao`, `preco`, `conteudo`, `publicado`, `fornecedorid`) VALUES
(45, 'Curso de Blazor', 'WebAssembly com C#', , 'Blazor é uma tecnologia inovadora para criar aplicações web interativas utilizando C# em vez de JavaScript. Neste curso, você aprenderá a construir componentes Blazor, gerenciar estados, e integrar com serviços backend para criar aplicações web robustas e modernas.', 'Blazor', '2024-06-30', 5, 'Fornecedor 2', '18h', 180.00, 'https://www.youtube.com/watch?v=blazor-webassembly', 0, 2);
INSERT INTO `cursos` (`id`, `titulo`, `subtitulo`, `foto`, `desc_principal`, `desc_secundaria`, `atualizacao`, `estrelas`, `criador`, `duracao`, `preco`, `conteudo`, `publicado`, `fornecedorid`) VALUES
(46, 'Curso de API REST com C#', 'APIs com C#', , 'Neste curso, você aprenderá a criar APIs RESTful utilizando C#. Abordamos desde o básico da criação de endpoints até técnicas avançadas como autenticação JWT, versionamento de APIs, e boas práticas de segurança e performance. Ideal para quem deseja construir serviços backend robustos.', 'API REST', '2024-06-30', 4, 'Gabriel', '14h', 140.00, 'https://www.youtube.com/watch?v=api-rest-csharp', 0, 4);
INSERT INTO `cursos` (`id`, `titulo`, `subtitulo`, `foto`, `desc_principal`, `desc_secundaria`, `atualizacao`, `estrelas`, `criador`, `duracao`, `preco`, `conteudo`, `publicado`, `fornecedorid`) VALUES
(47, 'Desenvolvimento de Jogos com Unity', 'Jogos com Unity', , 'Aprenda a criar jogos utilizando Unity e C#. Este curso cobre desde os fundamentos do desenvolvimento de jogos até técnicas avançadas como física, animação, inteligência artificial, e criação de interfaces de usuário. Inclui projetos práticos para aplicar o conhecimento adquirido.', 'Unity', '2024-06-30', 5, 'Fornecedor 2', '30h', 300.00, 'https://www.youtube.com/watch?v=jogos-unity', 0, 2);
INSERT INTO `cursos` (`id`, `titulo`, `subtitulo`, `foto`, `desc_principal`, `desc_secundaria`, `atualizacao`, `estrelas`, `criador`, `duracao`, `preco`, `conteudo`, `publicado`, `fornecedorid`) VALUES
(48, 'Curso de Testes Unitários com NUnit', 'Testes com NUnit', , 'Garantir a qualidade do código é essencial, e este curso sobre testes unitários com NUnit ensina como fazer isso de maneira eficaz. Aprenda a escrever testes unitários, configurar o NUnit, e integrar os testes no processo de desenvolvimento para criar aplicações mais confiáveis.', 'NUnit', '2024-06-30', 4, 'Gabriel', '6h', 60.00, 'https://www.youtube.com/watch?v=tests-nunit', 0, 4);
INSERT INTO `cursos` (`id`, `titulo`, `subtitulo`, `foto`, `desc_principal`, `desc_secundaria`, `atualizacao`, `estrelas`, `criador`, `duracao`, `preco`, `conteudo`, `publicado`, `fornecedorid`) VALUES
(49, 'Curso de Programação Assíncrona com C#', 'Async com C#', , 'A programação assíncrona é crucial para criar aplicações responsivas e performáticas. Neste curso, você aprenderá a utilizar async e await em C#, manipular tarefas assíncronas, e evitar armadilhas comuns que podem afetar a performance da aplicação.', 'Programação Assíncrona', '2024-06-30', 5, 'Fornecedor 2', '9h', 90.00, 'https://www.youtube.com/watch?v=async-csharp', 0, 2);
INSERT INTO `cursos` (`id`, `titulo`, `subtitulo`, `foto`, `desc_principal`, `desc_secundaria`, `atualizacao`, `estrelas`, `criador`, `duracao`, `preco`, `conteudo`, `publicado`, `fornecedorid`) VALUES
(50, 'Curso de Design Patterns com C#', 'Padrões de Projeto', , 'Domine os padrões de design em C# para criar código mais organizado, reutilizável e fácil de manter. Este curso aborda os principais padrões de design, como Singleton, Factory, Strategy, e muitos outros, com exemplos práticos e aplicáveis no dia a dia de desenvolvimento.', 'Design Patterns', '2024-06-30', 4, 'Gabriel', '16h', 160.00, 'https://www.youtube.com/watch?v=design-patterns-csharp', 0, 4);

